import React from 'react';
import { FaHome, FaChartLine, FaUser, FaShoppingCart, FaBell } from 'react-icons/fa'; // Icons from react-icons
import './homepage.css'; 
import 'bootstrap/dist/css/bootstrap.min.css'; // Ensure Bootstrap CSS is loaded
import { Link } from 'react-router-dom';





function Homepage() {
  // Print function
  const myFunction = () => {
    window.print(); 
  };

  return (
    <div className="app-container">
      {/* Sidebar Section */}
      <div className="sidebar">
        <div className="sidebar-header">
          <h2>Container</h2> 
        </div>

        <div className="sidebar-menu">
          <Link to="/" className="menu-item">
            <FaHome className="icon" />  
            <span>Register</span>
          </Link>
          <Link to="/sales" className="menu-item">
            <FaShoppingCart className="icon" />
            <span>Livestream</span>
          </Link>
          <Link to="/customer" className="menu-item">
            <FaUser className="icon" />
            <span>Q-A Assistant</span>
          </Link>
          
          <Link to="/catalog" className="menu-item">
            <FaChartLine className="icon" />
            <span>Database</span>
          </Link>
          
        </div>

        <div className="sidebar-footer">
          <span className="user-name">POORANI</span>
        </div>
      </div>

      <div className="main-content">
        <div className="container mt-3">
          
        </div>
      </div>
    </div>
  );
}

export default Homepage;
